import { useLocation } from 'react-router-dom';
import { Patient } from './interfaces';

function PatientDashboard(props: any) {
  const location = useLocation();
  const patient: Patient = location.state;

  return (
    <div>
        hi
      <h2>Welcome {patient.firstName} {patient.lastName}!</h2>
      <p>Your phone number is: {patient.phoneNumber}</p>
      <p>Your address is: {patient.address}, {patient.city}, {patient.zipCode}</p>
    </div>
  );
}

export default PatientDashboard;
